var $originalDateString = "2023-11-24 00:00:00";

// Parse the original date string
var $originalFormat = new java.text.SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
var $date = $originalFormat.parse($originalDateString);

// Create a new date format
var $newFormat = new java.text.SimpleDateFormat("dd-MMM-yyyy");

// Format the date to the desired format
var $newDateString = $newFormat.format($date);
//$newDateString

// Print the result
_log("Original Date: " +$originalDateString);
_log("Formatted Date: " + $newDateString);
